import React from 'react'
import Box from './Box.jsx'
import './Board.css'

const Board = (props) => {
    return (
        <div className="board">
        {props.board_list.map( (item, index) => (
            <Box value={item} id={index}/>
            ))}
    </div>
    )
}

export default Board
